import React, { useState } from "react"

function Body(){

  const [dataToggle, setDataToggle] = useState("");
  const [dataTarget, setDataTarget] = useState("");
  
  function handleClick(){
  
    setDataToggle("collapse");
    setDataTarget("#navbarToggleExternalContent");

    document.getElementsByClassName("navbar-dark navbar-toggler-icon").style.backgroundImage = "url(https://i.ibb.co/rt3HybH/close.png)"

    // document.getElementsByClassName("navbar-toggler-icon").className = "bi bi-x-lg"
    // $("#navbarToggleExternalContent").animate({width:'toggle'},350)
    // document.getElementById("navbar").style.width = "300px"
    // document.getElementById("navSlide").className = "slide";
    // document.getElementById("navSlide").css("-webkit-animation-name", "fadeInRight")
    // document.getElementsByClassName("navbar-toggler-icon").css("background-image", "url(https://icons.getbootstrap.com/assets/icons/x-lg.svg)")
  
  }

    return (
      <>

<header>
  <h1>Montana</h1>

  
<div class="pos-f-t" id="my-navbar-collapse">
      <div class="collapse navbar-collapse" id="navbarToggleExternalContent">
        <div class="p-4 menu">
          <ul class="nav navbar-nav">

            <li>
              <a class="nav-link" href="#about-me">About</a>
            </li>
            <li>
              <a class="nav-link" href="#skills">Skills</a>
            </li>
            <li>
              <a class="nav-link" href="#contact-me">Contact</a>
            </li>
            <li>
              <a class="nav-link" href="Jeffin_Jaison_CV.pdf">CV</a>
            </li>
    
          </ul>
        </div>
      </div>
      <nav class="navbar navbar-dark" id="closeNav">
        <button class="navbar-toggler" 
        type="button" 
        data-toggle={dataToggle} 
        data-target={dataTarget}
        aria-controls="navbarToggleExternalContent"
        aria-expanded="false"
        aria-label="Toggle navigation"
        onClick={handleClick}>
          <span class="navbar-toggler-icon"></span>
        </button>
      </nav>
    </div>
</header>

</>)}

export default Body;
